import { createSlice } from "@reduxjs/toolkit";
import data from './../data.js'

let items = createSlice({
    name: 'items',
    initialState: data,
    reducer: {
        pushNewItem(state, action) {
            console.log("룰루랄라")
            // console.log(state, action.payload);
            Array.prototype.push.apply()
        }
    }
});

export default items;
